import React from "react";

function Card(props)
{
    return(
        <div className="card">
        <div className="top">
          <h2 className="name">{props.name}</h2>
          <img
            className="circle-img"
            src={props.imgsource}
            alt="avatar_img"
          />
        </div>
        <div className="bottom">
          <p className="info">{props.tel}</p>
          <p className="info">b@beyonce.com</p>
        </div>
      </div>
    );
}

export default Card;
